import React from 'react';
import './App.css';
// import MemberPanel from "./member/memberPanel";
// import MatchPanel from "./match/matchPanel";
import CivPanel from "./techtree/civPanel";
import TreePanel from "./techtree/panels/treePanel";


function App() {
  return (
    <div className="App">
      <h4> AGE OF EMPIRES 2 TECHNOLOGY TREE </h4>
      <div>
        <CivPanel />
        <TreePanel build="Archery Range"/>
        <TreePanel build="Baracks"/>
        <TreePanel build="Stable"/>
        <TreePanel build="Seige Workshop"/>
        <TreePanel build="Castle"/>
        <TreePanel build="Blacksmith"/>
        <TreePanel build="University"/>
        <TreePanel build="Dock"/>

      </div>
    </div>
  );
}

export default App;
